import React from 'react';
import { Link } from 'react-router-dom';
Link

function Nav() {
    return (
        <ul className='liste'>
            <Link to='/'>
                <li className='items'>Accueil</li>
            </Link>
            <Link to='/about'>
                <li className='items'>A Propos</li>
            </Link>
        </ul>
    );
}

export default Nav;
